use std::io::{stdin, BufRead};

const P: usize = 1000000007;

fn main() {
    let mut buf = String::new();
    stdin().lock().read_line(&mut buf).unwrap();
    let n = buf.trim().parse::<usize>().unwrap();
    let (mut x, mut i) = start_point(n);
    while i < n {
        i += 1;
        x = ((x as i64) - (i as i64)).abs_diff(0) as usize;
        if i % 3 == 0 {
            x = ((x % P) * (i % P)) % P;
        }
        if i % 15 == 0 {
            x = x & i;
        }
        if i % 63 == 0 {
            x = x ^ i;
        }
        if i % 255 == 0 {
            x = x | i;
        }
        if i % 1023 == 0 {
            x = ((x % P) * mod_pow(2, i)) % P;
        }
    }
    println!("{x}");
}

fn start_point(n: usize) -> (usize, usize) {
    if DATA_MAX <= n {
        return (*DATA.last().unwrap(), DATA_MAX);
    }
    let x = DATA[n / INTERVAL];
    let i = n / INTERVAL * INTERVAL;
    (x, i)
}

fn mod_pow(val: usize, mut exp: usize) -> usize {
    let mut result = 1;
    let mut sub_power = val % P;

    while exp > 0 {
        if exp % 2 == 1 {
            result = (result * sub_power) % P;
        }
        exp /= 2;
        sub_power = (sub_power * sub_power) % P;
    }
    result
}

